import React from "react";
import { Formik } from "formik";
import * as Yup from 'yup';
import "./styles.css";
import Button from '@mui/material/Button';
import { useNavigate } from "react-router-dom";

import { createTheme, ThemeProvider, useTheme } from '@mui/material/styles';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';

//Theme Configuration
const theme = createTheme({
  status: {
    danger: '#e53e3e',
  },
  palette: {
    primary: {
      main: '#ff8a00',
      //   darker: '#053e85',
    },
    neutral: {
      main: '#ffffff',
      contrastText: '#ff8a00',
    },
  },
});

//Role Selector Configuration
const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
  PaperProps: {
    style: {
      maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
      width: 250,
    },
  },
};

const roles = [
  'Member',
  'Curriculum Instructor',
];

function getStyles(role, roles, theme) {
  return {
    fontWeight:
      roles.indexOf(role) === -1
        ? theme.typography.fontWeightRegular
        : theme.typography.fontWeightMedium,
  };
}

function RoleSelector() {
  const [roles, setRoles] = React.useState([]);

  const handleChange = (event) => {
    const {
      target: { value },
    } = event;
    setRoles(
      typeof value === 'string' ? value.split(',') : value,
    );
  };

  return (
    <div>
      <FormControl sx={{ m: 1, width: 300 }}>
        <InputLabel id="desiredRoles">Intended Roles</InputLabel>
        <Select
          labelId="roles"
          id="roles"
          multiple
          value={roles}
          onChange={handleChange}
          input={<OutlinedInput label="Role" />}
          MenuProps={MenuProps}
        >
          {roles.map((role) => (
            <MenuItem
              key={role}
              value={role}
              // style={getStyles(role, roles, theme)}
            >
              {role}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
    </div>
  );
}


const ApplicationForm = () => {
  const navigate = useNavigate();

  const navToHome = () => {
    navigate("/");
  }
  return (
    <ThemeProvider theme={theme}>
      <Formik
        initialValues={{
          firstName: '',
          lastName: '',
          timestamp: Date.now(),
        }}
        validationSchema={
          Yup.object(
            {
              firstName: Yup.string().required('Required'),
              lastName: Yup.string().required('Required'),
            }
          )
        }
        onSubmit={async (values) => {
          // fetch('<ENTER API ENDPOINT HERE>', {
          //   method: 'POST',
          //   headers: { 'Content-Type': 'application/json' },
          //   body: JSON.stringify({
          //     first_name: values.firstName,
          //     last_name: values.lastName,
          //     time_created: values.timestamp,
          //    })
          // });
          await new Promise((r) => setTimeout(r, 500));
          alert(JSON.stringify(values, null, 2));
        }}
      >
        {formik => (
          <div>
            <span>

              <Button style={{ "display": "flex" }}
                variant="contained"
                color="neutral"
                onClick={navToHome}
                className="navHome">Return Home</Button>

              <h1 style={{ "display": "flex" }}>PlexTech Member Application - Spring 2023</h1>

              <br />
            </span>

            <div>
              <h4>Thank you for your interest in PlexTech! Please fill out the information below and we will get back to you as soon as possible.</h4>

              <form onSubmit={formik.handleSubmit}>

                {/* First Name */}
                <label htmlFor="firstName">First Name</label>
                <input
                  id="firstName"
                  type="text"
                  {...formik.getFieldProps('firstName')} />
                {formik.touched.firstName && formik.errors.firstName ? <div>{formik.errors.firstName}</div> : null}

                {/* Last Name */}
                <label htmlFor="lastName">Last Name</label>
                <input
                  id="lastName"
                  type="text"
                  {...formik.getFieldProps('lastName')} />
                {formik.touched.lastName && formik.errors.lastName ? <div>{formik.errors.lastName}</div> : null}

                {/* Timestamp */}
                <label htmlFor="timestamp">Timestamp</label>
                <input
                  id="timestamp"
                  name="timestamp"
                  type="text"
                  readOnly
                  value={formik.values.timestamp} />

                {/* Desired Roles */}
                <RoleSelector className='Field'/>

                {/* Submit Button */}
                <div>
                  <Button type="submit"
                    variant="contained"
                    color="neutral"
                    fontweight="Bold"
                  >Submit</Button>
                </div>
              </form>
            </div>
          </div>
        )}
      </Formik>
    </ThemeProvider>
  );
};

export default ApplicationForm;
